from bs4 import BeautifulSoup
import json

def extract_data(html_content):
    # Parse HTML content
    soup = BeautifulSoup(html_content, 'html.parser')
    
    # Initialize dictionary to store extracted data
    data = {}
    
    # Find all elements in the HTML
    elements = soup.find_all()
    
    # Iterate through each element
    for element in elements:
        # Extract ID (if exists) or generate a unique identifier for the element
        element_id = element.get('id') or f"element_{len(data)}"
        
        # Extract inner text of the element
        inner_text = element.get_text(strip=True)
        
        # Store inner text in the data dictionary using ID as key
        if inner_text:
            data[element_id] = inner_text
    
    return data

def generate_json(html_content):
    # Extract data from HTML content
    extracted_data = extract_data(html_content)
    
    # Convert extracted data to JSON format
    json_data = json.dumps(extracted_data, indent=4)
    
    return json_data

